    setHeaderVariant(selectedVariant);
    setNavigationItems(selectedVariant === "Header Variant 2" ? [<Button key={"fullscreen"} icon={fullscreenIcon} design={ButtonDesign.Transparent} />, <Button key={"exitFullscreen"} icon={exitFSIcon} design={ButtonDesign.Transparent} />, <Button key={"decline"} icon={declineIcon} design={ButtonDesign.Transparent} />] : [<Button key={"decline"} icon={declineIcon} design={ButtonDesign.Transparent} />]);
